window.bookSummaryJSON = "<p>The time has come for Roiben's coronation, and pixie Kaye is sure of one thing – she loves him. When she declares herself to Roiben during the celebration, he's forced to send her on a seemingly impossible quest to find a faerie who can tell a lie.</p> <p>But Kaye's adventure soon leads to danger when she finds herself caught up in the games of the Seelie Court. Queen Silarial wants Roiben's throne, and she will use any means necessary to get it. Can a pixie outplay a queen?</p>"; 
